import React, { Component } from "react";
import Jumbotron from "../components/Jumbotron";

class Saved extends Component {
  render() {
    return (
      <Jumbotron>
        <h1>BookShelf</h1>
        <h3>View your saved books</h3>
      </Jumbotron>
    );
  }
}

export default Saved;
